import React from 'react';
import { Card, CardContent, Typography, Box, Grid, Table, TableBody, TableCell, TableContainer, TableHead, TableRow } from '@mui/material';
import { BarChart } from '@mui/x-charts/BarChart';
import { LineChart } from '@mui/x-charts/LineChart';
import { PieChart } from '@mui/x-charts/PieChart';

const ProjectionsChart = () => {
  const data = [20, 35, 25, 45, 30, 40, 35, 50, 45, 35, 40, 30];
  const xLabels = ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun', 'Jul', 'Aug', 'Sep', 'Oct', 'Nov', 'Dec'];

  return (
    <Card sx={{ height: 300 }}>
      <CardContent sx={{ p: 2.5, height: '100%' }}>
        <Typography variant="body1" sx={{ mb: 2, fontWeight: 600, fontSize: '1rem' }}>
          Projections vs Actuals
        </Typography>
        <Box sx={{ height: 220, width: '100%' }}>
          <BarChart
            series={[{ data, color: '#3b82f6' }]}
            xAxis={[{ data: xLabels, scaleType: 'band', tickLabelStyle: { fontSize: 12 } }]}
            height={220}
            margin={{ left: 20, right: 20, top: 20, bottom: 30 }}
            slotProps={{
              bar: {
                rx: 4,
              },
            }}
          />
        </Box>
      </CardContent>
    </Card>
  );
};

const RevenueChart = () => {
  const currentWeek = [12, 8, 10, 15, 18, 20];
  const previousWeek = [8, 15, 17, 12, 10, 22];
  const xLabels = ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun'];

  return (
    <Card sx={{ height: 300, backgroundColor: '#f8fafc' }}>
      <CardContent sx={{ p: 2.5, height: '100%' }}>
        <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start', mb: 2 }}>
          <Typography variant="body1" sx={{ fontWeight: 600, fontSize: '1rem', color: '#374151' }}>
            Revenue
          </Typography>
          <Box sx={{ display: 'flex', gap: 3, fontSize: '0.75rem' }}>
            <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
              <Box sx={{ width: 8, height: 8, borderRadius: '50%', backgroundColor: '#000000' }} />
              <Typography variant="body2" sx={{ fontSize: '0.8rem', color: '#374151' }}>
                Current Week
              </Typography>
              <Typography variant="body2" fontWeight={600} sx={{ fontSize: '0.8rem', color: '#374151' }}>
                $58,211
              </Typography>
            </Box>
            <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
              <Box sx={{ width: 8, height: 8, borderRadius: '50%', backgroundColor: '#a7c7e7' }} />
              <Typography variant="body2" sx={{ fontSize: '0.8rem', color: '#374151' }}>
                Previous Week
              </Typography>
              <Typography variant="body2" fontWeight={600} sx={{ fontSize: '0.8rem', color: '#374151' }}>
                $68,768
              </Typography>
            </Box>
          </Box>
        </Box>
        <Box sx={{ height: 220, width: '100%' }}>
          <LineChart
            series={[
              { 
                data: currentWeek, 
                color: '#000000', 
                curve: 'natural',
                connectNulls: true
              },
              { 
                data: previousWeek, 
                color: '#a7c7e7', 
                curve: 'natural',
                connectNulls: true
              },
            ]}
            xAxis={[{ 
              data: xLabels, 
              scaleType: 'band', 
              tickLabelStyle: { fontSize: 12, fill: '#9ca3af' },
              axisLine: false,
              tickLine: false
            }]}
            yAxis={[{
              tickLabelStyle: { fontSize: 12, fill: '#9ca3af' },
              axisLine: false,
              tickLine: false,
              tickFormatter: (value) => `${value}M`
            }]}
            height={220}
            margin={{ left: 40, right: 20, top: 20, bottom: 40 }}
            grid={{ horizontal: true, vertical: false }}
          />
        </Box>
      </CardContent>
    </Card>
  );
};

const LocationChart = () => {
  const locations = [
    { name: 'New York', value: '72K' },
    { name: 'San Francisco', value: '39K' },
    { name: 'Sydney', value: '25K' },
    { name: 'Singapore', value: '61K' },
  ];

  return (
    <Card sx={{ height: 300, backgroundColor: '#f8fafc' }}>
      <CardContent sx={{ p: 2.5, height: '100%' }}>
        <Typography variant="body1" sx={{ mb: 2, fontWeight: 600, fontSize: '1rem', color: '#374151' }}>
          Revenue by Location
        </Typography>
        <Box sx={{ position: 'relative', height: '140px', mb: 2 }}>
          {/* World Map SVG */}
          <svg
            width="100%"
            height="100%"
            viewBox="0 0 400 200"
            style={{ backgroundColor: '#f8fafc' }}
          >
            {/* North America */}
            <path d="M20,60 Q30,50 50,55 L70,50 Q90,45 110,50 L120,55 Q130,60 140,55 L150,60 Q160,65 170,60 L180,65 Q190,70 200,65 L210,70 Q220,75 230,70 L240,75 Q250,80 260,75 L270,80 Q280,85 290,80 L300,85 Q310,90 320,85 L330,90 Q340,95 350,90 L360,95 Q370,100 380,95 L390,100 L390,140 Q380,135 370,140 L360,135 Q350,130 340,135 L330,130 Q320,125 310,130 L300,125 Q290,120 280,125 L270,120 Q260,115 250,120 L240,115 Q230,110 220,115 L210,110 Q200,105 190,110 L180,105 Q170,100 160,105 L150,100 Q140,95 130,100 L120,95 Q110,90 100,95 L90,90 Q80,85 70,90 L60,85 Q50,80 40,85 L30,80 Q20,75 20,60 Z" fill="#c7d2fe" opacity="0.7" />

            {/* South America */}
            <path d="M80,120 Q90,115 100,120 L110,125 Q120,130 130,125 L140,130 Q150,135 160,130 L170,135 Q180,140 190,135 L200,140 Q210,145 220,140 L230,145 Q240,150 250,145 L260,150 Q270,155 280,150 L290,155 Q300,160 310,155 L320,160 Q330,165 340,160 L350,165 Q360,170 370,165 L380,170 L380,190 Q370,185 360,190 L350,185 Q340,180 330,185 L320,180 Q310,175 300,180 L290,175 Q280,170 270,175 L260,170 Q250,165 240,170 L230,165 Q220,160 210,165 L200,160 Q190,155 180,160 L170,155 Q160,150 150,155 L140,150 Q130,145 120,150 L110,145 Q100,140 90,145 L80,140 Q80,120 80,120 Z" fill="#a7c7e7" opacity="0.6" />

            {/* Europe */}
            <path d="M180,40 Q190,35 200,40 L210,45 Q220,50 230,45 L240,50 Q250,55 260,50 L270,55 Q280,60 290,55 L300,60 Q310,65 320,60 L330,65 Q340,70 350,65 L360,70 Q370,75 380,70 L390,75 L390,100 Q380,95 370,100 L360,95 Q350,90 340,95 L330,90 Q320,85 310,90 L300,85 Q290,80 280,85 L270,80 Q260,75 250,80 L240,75 Q230,70 220,75 L210,70 Q200,65 190,70 L180,65 Q180,40 180,40 Z" fill="#c7d2fe" opacity="0.8" />

            {/* Asia */}
            <path d="M220,30 Q230,25 240,30 L250,35 Q260,40 270,35 L280,40 Q290,45 300,40 L310,45 Q320,50 330,45 L340,50 Q350,55 360,50 L370,55 Q380,60 390,55 L400,60 L400,90 Q390,85 380,90 L370,85 Q360,80 350,85 L340,80 Q330,75 320,80 L310,75 Q300,70 290,75 L280,70 Q270,65 260,70 L250,65 Q240,60 230,65 L220,60 Q220,30 220,30 Z" fill="#a7c7e7" opacity="0.7" />

            {/* Africa */}
            <path d="M160,80 Q170,75 180,80 L190,85 Q200,90 210,85 L220,90 Q230,95 240,90 L250,95 Q260,100 270,95 L280,100 Q290,105 300,100 L310,105 Q320,110 330,105 L340,110 Q350,115 360,110 L370,115 Q380,120 390,115 L400,120 L400,160 Q390,155 380,160 L370,155 Q360,150 350,155 L340,150 Q330,145 320,150 L310,145 Q300,140 290,145 L280,140 Q270,135 260,140 L250,135 Q240,130 230,135 L220,130 Q210,125 200,130 L190,125 Q180,120 170,125 L160,120 Q160,80 160,80 Z" fill="#c7d2fe" opacity="0.6" />

            {/* Australia */}
            <path d="M280,140 Q290,135 300,140 L310,145 Q320,150 330,145 L340,150 Q350,155 360,150 L370,155 Q380,160 390,155 L400,160 L400,180 Q390,175 380,180 L370,175 Q360,170 350,175 L340,170 Q330,165 320,170 L310,165 Q300,160 290,165 L280,160 Q280,140 280,140 Z" fill="#a7c7e7" opacity="0.5" />

            {/* Location dots */}
            <circle cx="70" cy="70" r="2.5" fill="#000000" />
            <circle cx="50" cy="80" r="2.5" fill="#000000" />
            <circle cx="320" cy="160" r="2.5" fill="#000000" />
            <circle cx="350" cy="90" r="2.5" fill="#000000" />
          </svg>
        </Box>
        <Box>
          {locations.map((location, index) => (
            <Box key={index} sx={{ mb: 1.5 }}>
              <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 0.5 }}>
                <Typography variant="body2" sx={{ fontSize: '0.8rem', color: '#374151' }}>
                  {location.name}
                </Typography>
                <Typography variant="body2" fontWeight={600} sx={{ fontSize: '0.8rem', color: '#374151' }}>
                  {location.value}
                </Typography>
              </Box>
              <Box sx={{ width: '100%', height: 4, backgroundColor: '#e5e7eb', borderRadius: 2 }}>
                <Box 
                  sx={{ 
                    width: `${parseInt(location.value)}%`, 
                    height: '100%', 
                    backgroundColor: '#A8C5DA', 
                    borderRadius: 2 
                  }} 
                />
              </Box>
            </Box>
          ))}
        </Box>
      </CardContent>
    </Card>
  );
};

const TopProducts = () => {
  const products = [
    { name: 'ASOS Ridley High Waist', price: '$79.49', sold: 82, revenue: '$6,518.18' },
    { name: 'Marco Lightweight Shirt', price: '$128.50', sold: 37, revenue: '$4,754.50' },
    { name: 'Half Sleeve Shirt', price: '$39.99', sold: 64, revenue: '$2,559.36' },
    { name: 'Lightweight Jacket', price: '$20.00', sold: 184, revenue: '$3,680.00' },
    { name: 'Marco Shoes', price: '$79.49', sold: 64, revenue: '$1,965.81' },
  ];

  return (
    <Card sx={{ height: 300, backgroundColor: '#F7F9FB' }}>
      <CardContent sx={{ p: 2.5, height: '100%' }}>
        <Typography variant="body1" sx={{ mb: 3, fontWeight: 600, fontSize: '1rem', color: '#374151' }}>
          Top Selling Products
        </Typography>
        <Box sx={{ height: 'calc(100% - 50px)' }}>
          {/* Header Row */}
          <Box sx={{ display: 'flex', pb: 2, borderBottom: '1px solid #e5e7eb', mb: 2 }}>
            <Typography variant="body2" sx={{ flex: 3, fontSize: '0.75rem', color: '#9ca3af', fontWeight: 500 }}>
              Name
            </Typography>
            <Typography variant="body2" sx={{ flex: 1, fontSize: '0.75rem', color: '#9ca3af', fontWeight: 500, textAlign: 'center' }}>
              Price
            </Typography>
            <Typography variant="body2" sx={{ flex: 1, fontSize: '0.75rem', color: '#9ca3af', fontWeight: 500, textAlign: 'center' }}>
              Quantity
            </Typography>
            <Typography variant="body2" sx={{ flex: 1, fontSize: '0.75rem', color: '#9ca3af', fontWeight: 500, textAlign: 'right' }}>
              Amount
            </Typography>
          </Box>

          {/* Data Rows */}
          {products.map((product, index) => (
            <Box key={index} sx={{ display: 'flex', py: 1.5, alignItems: 'center' }}>
              <Typography variant="body2" sx={{ flex: 3, fontSize: '0.85rem', color: '#374151', fontWeight: 400 }}>
                {product.name}
              </Typography>
              <Typography variant="body2" sx={{ flex: 1, fontSize: '0.85rem', color: '#374151', textAlign: 'center' }}>
                {product.price}
              </Typography>
              <Typography variant="body2" sx={{ flex: 1, fontSize: '0.85rem', color: '#374151', textAlign: 'center' }}>
                {product.sold}
              </Typography>
              <Typography variant="body2" sx={{ flex: 1, fontSize: '0.85rem', color: '#374151', fontWeight: 500, textAlign: 'right' }}>
                {product.revenue}
              </Typography>
            </Box>
          ))}
        </Box>
      </CardContent>
    </Card>
  );
};

const TotalSalesChart = () => {
  const data = [
    { id: 0, value: 38.6, label: 'Direct', color: '#1f2937' },
    { id: 1, value: 22.5, label: 'Affiliate', color: '#10b981' },
    { id: 2, value: 30.8, label: 'Sponsored', color: '#8b5cf6' },
    { id: 3, value: 8.1, label: 'E-mail', color: '#06b6d4' },
  ];

  const salesData = [
    { label: 'Direct', value: '$300.56', color: '#1f2937' },
    { label: 'Affiliate', value: '$135.18', color: '#10b981' },
    { label: 'Sponsored', value: '$154.02', color: '#8b5cf6' },
    { label: 'E-mail', value: '$48.96', color: '#06b6d4' },
  ];

  return (
    <Card sx={{ height: 300, backgroundColor: '#F7F9FB' }}>
      <CardContent sx={{ p: 2.5, height: '100%' }}>
        <Typography variant="body1" sx={{ mb: 3, fontWeight: 600, fontSize: '1rem', color: '#374151' }}>
          Total Sales
        </Typography>
        <Box sx={{ display: 'flex', flexDirection: 'column', alignItems: 'center', height: 'calc(100% - 50px)' }}>
          <Box sx={{ width: 140, height: 140, position: 'relative', mb: 3 }}>
            <PieChart
              series={[
                {
                  data,
                  innerRadius: 45,
                  outerRadius: 70,
                  paddingAngle: 3,
                },
              ]}
              width={140}
              height={140}
            />
            <Box
              sx={{
                position: 'absolute',
                top: '50%',
                left: '50%',
                transform: 'translate(-50%, -50%)',
                backgroundColor: '#374151',
                color: 'white',
                px: 1.5,
                py: 0.5,
                borderRadius: 2,
                fontSize: '0.85rem',
                fontWeight: 600,
              }}
            >
              38.6%
            </Box>
          </Box>
          <Box sx={{ width: '100%' }}>
            {salesData.map((item, index) => (
              <Box
                key={index}
                sx={{
                  display: 'flex',
                  alignItems: 'center',
                  justifyContent: 'space-between',
                  mb: 1.5,
                }}
              >
                <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                  <Box
                    sx={{
                      width: 8,
                      height: 8,
                      borderRadius: '50%',
                      backgroundColor: item.color,
                    }}
                  />
                  <Typography variant="body2" sx={{ fontSize: '0.8rem', color: '#374151' }}>
                    {item.label}
                  </Typography>
                </Box>
                <Typography variant="body2" fontWeight={600} sx={{ fontSize: '0.8rem', color: '#374151' }}>
                  {item.value}
                </Typography>
              </Box>
            ))}
          </Box>
        </Box>
      </CardContent>
    </Card>
  );
};

const Charts = () => {
  return (
    <>
      <Grid container spacing={2} sx={{ mb: 2 }}>
        <Grid item xs={12} md={8.4}>
          <RevenueChart />
        </Grid>
        <Grid item xs={12} md={3.6}>
          <LocationChart />
        </Grid>
      </Grid>

      <Grid container spacing={2} sx={{ mb: 2 }}>
        <Grid item xs={12} md={8.4}>
          <TopProducts />
        </Grid>
        <Grid item xs={12} md={3.6}>
          <TotalSalesChart />
        </Grid>
      </Grid>
    </>
  );
};

export default Charts;
